  \"Compact, Efficient, and Reliable Ventilation Fan for EVA Suits Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 4,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:13:04.948731\",\n\t\"name\": \"compact-efficient-and-reliable-ventilation-fan-for-eva-suits-project-e2bee\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Advanced EVA suits for space exploration
  will need a portable life support system (PLSS) that is compact, lightweight, highly
  reliable, and meets stringent requirements for oxygen safety.  A key component is
  a blower that circulates gas through the space suit ventilation loop.  We propose
  to develop an innovative blower that can meet the challenging requirements for circulating
  ventilation gas in an EVA suit using a reliable system that consumes little power.
  \ The innovative design enables use of a wide range of materials that can be selected
  to maximize safety in an oxygen environment.  In Phase I we proved the feasibility
  of our approach by testing and optimizing blower components, producing a conceptual
  design for the blower and motor, and demonstrating a proof-of-concept blower under
  prototypical conditions.  In Phase II we will optimize the blower and motor designs
  to achieve small size and maximum efficiency while meeting requirements and constraints
  for operation in exploration space suits.  We will demonstrate lifetime and reliability
  of critical components in a prototypical oxygen environment and deliver a prototype
  blower that can be used in system tests of advanced portable life support systems.\",\n\t\"license_title\":
